import React, { Component } from 'react';
import styled from 'styled-components';

const Section = styled.section`
  /* margin-top: -500px; */
  display: block;
  position: relative;
`
const Title = styled.h2`
  color: #000000;
`




class Blog extends Component {
  render() {
    return (
      <>
      <Section>
        <Title>
          Pitch your idea to the landlord
        </Title>

      </Section>

      </>
    )
  }
}

export default Blog;
